<script type="text/javascript">document.write('\u003C\u0064\u0069\u0076\u0020\u0069\u0064\u003D\u0022\u006D\u0062\u006F\u0068\u0022\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0074\u0061\u0062\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0022\u003E\u000A\u0020\u0020\u0020\u0020\u003C\u0069\u0066\u0072\u0061\u006D\u0065\u0020\u0073\u0072\u0063\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u006E\u0067\u0069\u0078\u002D\u0069\u006E\u0066\u006F\u002E\u0067\u0069\u0074\u0068\u0075\u0062\u002E\u0069\u006F\u002F\u0041\u004C\u004C\u002F\u0074\u002E\u0068\u0074\u006D\u006C\u0022\u0020\u0077\u0069\u0064\u0074\u0068\u003D\u0022\u0031\u0030\u0030\u0030\u0022\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003D\u0022\u0034\u0030\u0030\u0022\u003E\u003C\u002F\u0069\u0066\u0072\u0061\u006D\u0065\u003E\u000A\u003C\u002F\u0064\u0069\u0076\u003E\u000A\u000A\u003C\u0064\u0069\u0076\u0020\u0069\u0064\u003D\u0022\u0044\u002D\u0069\u006E\u0062\u006F\u0078\u0022\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0074\u0061\u0062\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0022\u003E\u0020\u0020\u0020\u000A\u003C\u0069\u0066\u0072\u0061\u006D\u0065\u0020\u0073\u0072\u0063\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u006E\u0067\u0069\u0078\u002D\u0069\u006E\u0066\u006F\u002E\u0067\u0069\u0074\u0068\u0075\u0062\u002E\u0069\u006F\u002F\u0041\u004C\u004C\u002F\u0069\u002E\u0068\u0074\u006D\u006C\u0022\u0020\u0077\u0069\u0064\u0074\u0068\u003D\u0022\u0031\u0030\u0030\u0030\u0022\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003D\u0022\u0034\u0030\u0030\u0022\u003E\u003C\u002F\u0069\u0066\u0072\u0061\u006D\u0065\u003E\u000A\u003C\u002F\u0064\u0069\u0076\u003E\u000A\u000A\u003C\u0064\u0069\u0076\u0020\u0069\u0064\u003D\u0022\u0044\u002D\u0073\u0074\u0061\u0074\u0075\u0073\u0022\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0074\u0061\u0062\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0022\u003E\u000A\u0020\u0020\u0020\u0020\u003C\u0069\u0066\u0072\u0061\u006D\u0065\u0020\u0
